    public void run(ImageProcessor ip) {
		if (!showDialog()) return;
            
        int offset;
        width = ip.getWidth();
        height = ip.getHeight();
        size = width*height;
		max = 65535;
		int border = 3;
		int spacing = 10;
		int minWidth = 100;
		int minHeight= 100;
		int minArea = 130 * 100;
		FileInfo fi = imp.getOriginalFileInfo();
		
		ImageProcessor maskIp = ip.convertToShort(false);
		
		//Create binary with 1 = max
		for (int w=0;w<width;w++) {
			for (int h=0;h<height;h++) {
				if (ip.get(w,h) > 0) maskIp.set(w,h,max);
			}
		}
		
		getSections(maskIp);
		//ImagePlus maskImp = new ImagePlus("sections", maskIp);
		//maskImp.show();
		
		//Duplicate maskIp for coloring
		ColorProcessor colorMaskIp = maskIp.convertToColorProcessor();
		
		//Determine max and min values of coordinates (bounds)
		int[][] sectionSize = new int[n][4];
		
		//Set min values to max
		for (int i=1; i< n; i++) {
			sectionSize[i][0] = width;
			sectionSize[i][2] = height;
		}
		
		for (int w=0;w<width;w++) {
			for (int h=0;h<height;h++) {
				int secNr = maskIp.get(w,h);
				if (secNr == 0) continue;
				
				//Min x
				if (w < sectionSize[secNr][0] || w == 0) sectionSize[secNr][0] = w;
				//Max x
				if (w > sectionSize[secNr][1]) sectionSize[secNr][1] = w;
				
				//Min y
				if (h < sectionSize[secNr][2] || h == 0) sectionSize[secNr][2] = h;
				
				//Max y
				if (sectionSize[secNr][3] < h) sectionSize[secNr][3] = h;
			}
		}
		
		//Transfer vessels to new images
		ArrayList<ImageProcessor> vesselImages = new ArrayList<ImageProcessor>();
		vesselImages.add(ip.createProcessor(0,0));
		
		for (int i = 1; i < n; i++) {
			
			vesselImages.add(ip.createProcessor(
				sectionSize[i][1] - sectionSize[i][0] + 1 + 2*border,
				sectionSize[i][3] - sectionSize[i][2] + 1 + 2*border
				)
			);
			
			//IJ.log(i+" created width: "+(sectionSize[i][1]  - sectionSize[i][0])+", height: "+(sectionSize[i][3] - sectionSize[i][2]));

		}
		//IJ.log("n = "+n+", vesselImages size: "+vesselImages.size());
		
		for (int w=0;w<width;w++) {
			for (int h=0;h<height;h++) {
				int secNr = maskIp.get(w,h);
				if (secNr == 0) continue;
				
				//maskIp.set(w,h,0);
				vesselImages.get(secNr).set(w-sectionSize[secNr][0]+border,h-sectionSize[secNr][2]+border,255);
			}
		}
		
		String[] circleMaskStrings = circleMaskString.split(",");
		float[] circleMask = new float[circleMaskStrings.length];
		for (int i = 0; i < circleMaskStrings.length; ++i) {
			float number = Float.parseFloat(circleMaskStrings[i]);
			circleMask[i] = number;
		}
		
		Convolver vesselConvolver = new Convolver();
		int cmw = 121;
		int cmh = 121;
		boolean[] toBeColoured = new boolean[n];
		int matched = 0;
		
		for (int i = 1; i < n; i++) {
			//ImagePlus newImp = new ImagePlus(origFileName+"_vessel_"+i, vesselImages.get(i));
			//IJ.log("Height: "+(vesselImages.get(i).getHeight()-border));
			//IJ.log("Width: "+(vesselImages.get(i).getHeight()-border));
			//IJ.log("Area: "+((vesselImages.get(i).getWidth()-border) * (vesselImages.get(i).getHeight()-border)));
			if ((vesselImages.get(i).getHeight()-border > 100 || vesselImages.get(i).getWidth()-border > 100) && ((vesselImages.get(i).getWidth()-border) * (vesselImages.get(i).getHeight()-border)) > minArea) {
			//	ImagePlus newImp = new ImagePlus("vessel_"+i, vesselImages.get(i));
			//	newImp.show();
				vesselConvolver.convolve(vesselImages.get(i), circleMask, cmw, cmh);
				loopVess:
				for (int h = 0; h < vesselImages.get(i).getHeight(); h++) {
					for (int w = 0; w < vesselImages.get(i).getWidth(); w++) {
						if (vesselImages.get(i).get(w,h) > 8) {
							toBeColoured[i] = true;
							matched++;
						//	ImagePlus newImpConv = new ImagePlus("convolved_vessel_"+i, vesselImages.get(i));
						//	newImpConv.show();
							break loopVess;
						}
					}
				}
			}
			
			//FileSaver newImpSaver = new FileSaver(newImp);
			//IJ.log(savePath+origFileName+"_vessel_"+i+".png");
			//newImpSaver.saveAsPng(savePath+origFileName+"_vessel_"+i+".png");
			//newImp.show();
		}
		
		//Colour the matched vessels
				
		for (int h = 0; h < colorMaskIp.getHeight(); h++) {
			for (int w = 0; w < colorMaskIp.getWidth(); w++) {
				int secNr = maskIp.get(w,h);
				if (secNr == 0) continue;
				else if (toBeColoured[secNr]) {
					colorMaskIp.setColor(Color.RED);
					colorMaskIp.drawPixel(w,h);
				}
				else {
					colorMaskIp.setColor(Color.BLACK);
					colorMaskIp.drawPixel(w,h);
				}
			}
		}
		
		ResultsTable rt = ResultsTable.getResultsTable();	
		rt.showRowNumbers(false);
		
		rt.incrementCounter();
		rt.addValue("Image", fi.fileName);
		rt.addValue("Template matches", matched);
		
		rt.show("Results");
		
		ImagePlus colormaskImp = new ImagePlus("coloredVessels", colorMaskIp);
		colormaskImp.show();
		
    }
	
	public void getSections(ImageProcessor src) {
		
 		FloodFiller ff = new FloodFiller(src);
    	n = 1;
    	
    	loopSec:
    	for (int y= 0; y < height; y++) {
    		for (int x = 0; x < width; x++) {
    			if (src.get(x,y) > n) {
    				
    				if (n >= max) break loopSec;
    				
    				src.setValue((double)n);
    				ff.fill8(x,y);
    				n++;
    			}
    		}
    	}
    }
	
